script: |
  super -f text -I q3016.spq | sort > q3016.out

inputs:
  - name: q3016.spq
    data: |
      SELECT ALL * FROM tab1 (FORMAT parquet) AS cor0 WHERE NOT 93 BETWEEN - + col2 * - col1 + - col0 + 65 + col1 AND ( 82 - col0 * col2 );
  - name: tab1

outputs:
  - name: q3016.out
    data: |
      51	14	96
      85	5	59
      91	47	68
